import data from '../Data'

function MijnGroningen() {

  const project = data.projects[0];
    return (
      < >
      <main className='bg-backgroundcolor'>
      <section className='text-textcolor py-12 px-4 bg-darkblue md:px-16 h-screen gap-2'>
      <h1 className='text-3xl py-4 md:py-8 font-bold text-textcolor' id='ervaring'>{project.name}</h1>
      <p className='col-span-2 text-md font-regular text-textcolor'>{project.subtitle}</p>
                                <p className='col-start-1 col-span-2 row-span-1 flex gap-2'>
                                    {project.tags.map((tag => (
                                        <span className='bg-primary p-1 rounded text-textcolor'>
                                            {tag}
                                        </span>
                                    )))}
                                </p>
      </section>
      </main>
      </>
    );
  }

  export default MijnGroningen;
